import React from 'react'

const StartRating = () => {
  return (
    <div>
      <div>
        {Array.from({ length: 5 }, (_, i) =>(
           <span>S{i + 1}</span>
           ))}
      </div>
      <p></p>
    </div>
  )
}

export default StartRating
